#Functions to print basic useful details for a given column

def get_column_details(column,df):
  # 1 print
  print("Details of" ,column, 'Column')

  # 2 Data types of column
  print("\nDataType",df[column].dtype)

  # 3 Check if null values are persent
  count_null = df[column].isnull().sum()
  if count_null ==0:
    print("\nNo null values are found")
  else:
    print("\nTotal",count_null,"null values")

  # 4 get number of unique values
  print("\nThere are",df[column].nunique(),"unique values")

  # 5 get distribution of column
  print("\nDistribution of column:\n")
  print(df[column].value_counts())

