#funtions to fill missing values using mode for categorical column
def fill_missing_values_with_column_mode(df,group_by,column):
  print("\nNumber of missing values before filling with column mode",df[column].isnull().sum())

  #Assign np.NAN to None
  if df[column].isin([None]).sum()>0:
    df.loc[df[column].isin([None]),column]=np.NaN

  #fill with column mode
  column_mode = df.groupby(by=group_by)[column].transform(lambda x: x.mode().iat[0] if not x.mode().empty else np.NaN )
  df[column]=df[column].fillna(column_mode)

  print("\nNumber of missing value after filling column mode",df[column].isnull().sum())

