def fill_missing_value_with_group_median(df,group_by,column):
  print("\nNumber of missing values before filling with column median",df[column].isnull().sum())
  if df[column].isnull().sum()>0:

    #fill with group median
    grp_median = df.groupby(by= group_by)[column].transform(lambda x: x.median())
    df[column] = df[column].fillna(grp_median)
    print("\nNumber of missing value after filling column median",df[column].isnull().sum())

