def fill_with_group_mean(df, group_by, column):
    print('Number of None values before filling with mean: ------------>', df[column].isnull().sum())

    if df[column].isnull().sum() > 0:
        mean = df.groupby(by=group_by)[column].transform(lambda x: x.mean() if x.notnull().any() else np.NaN)

        df[column] = df[column].fillna(mean)

    print('Number of None values after filling with mean: ------------>', df[column].isnull().sum())

