def assign_risk_catgry(row):
    if row['LTV_new_catgry'] == 'Low LTV' and row["credit_score_catgry"] == 'Excellent' and (row['income_catgry'] == 'High' or row['income_catgry'] == 'Upper-Middle'):
        return "Very Low Risk"
    elif row['LTV_new_catgry'] == 'Low LTV' and row["credit_score_catgry"] == 'Good' and (row['income_catgry'] == 'Middle' or row['income_catgry'] == 'Upper-Middle'):
        return "Low Risk"
    elif row['LTV_new_catgry'] == 'Medium LTV' and row["credit_score_catgry"] == 'Fair' and row['income_catgry'] == 'Middle':
        return "Medium Risk"
    elif row['LTV_new_catgry'] == 'Medium LTV' and row["credit_score_catgry"] == 'Good' and row['income_catgry'] == 'Upper-Middle':
        return "Medium-Low Risk"
    elif row['LTV_new_catgry'] == 'Medium LTV' and row["credit_score_catgry"] == 'Poor' and row['income_catgry'] == 'Lower-Middle':
        return "Medium-High Risk"
    elif row['LTV_new_catgry'] == 'High LTV' and row["credit_score_catgry"] == 'Poor' and (row['income_catgry'] == 'Lower-Middle' or row['income_catgry'] == 'Low'):
        return "High Risk"
    elif row['LTV_new_catgry'] == 'High LTV' and row["credit_score_catgry"] == 'Very Poor' and row['income_catgry'] == 'Low':
        return "Very High Risk"
    elif row['LTV_new_catgry'] == 'Very High LTV' and row["credit_score_catgry"] == 'Very Poor' and row['income_catgry'] == 'Low':
        return "Extremely High Risk"
    elif row['LTV_new_catgry'] == 'Very High LTV' and row["credit_score_catgry"] == 'Poor' and row['income_catgry'] == 'Middle':
        return "Extremely High Risk"
    else:
        return "Moderate Risk"

df['risk_catgry']= df.apply(assign_risk_catgry, axis=1)

df["debt_to_income"]=df['debt_to_income'].round(2)

