#cohens d

default_col = default_df['loan_amount']

non_default_col = non_default_df['loan_amount']

default_mean = np.mean(default_col)

non_default_mean = np.mean(non_default_col)


cohens_d = (default_mean - non_default_mean) / np.sqrt((default_col.var() + non_default_col.var()) / 2)
print(f"Cohen's d: {cohens_d}")

"""-ve sign indicate that  non default loan loan amount has high mean and 0.15 suggest that impact of loan amount on default status is small

Cohen's d will give you the standardized effect size:

|d| < 0.2: Small effect

0.2 ≤ |d| < 0.5: Medium effect

|d| ≥ 0.5: Large effect
"""

columns_list = ['rate_of_interest', 'upfront_charges','loan_amount',
       'property_value', 'income', 'credit_score', 'LTV_new',
       'debt_to_income', 'loan_x_interest_rate', 'loan_x_upfront_charge',
       'creditscore_x_property_value']
for column in columns_list:
  default_col = default_df[column]
  non_default_col = non_default_df[column]

  default_mean = np.mean(default_col)
  non_default_mean = np.mean(non_default_col)

  cohens_d = (default_mean - non_default_mean) / np.sqrt((default_col.var() + non_default_col.var()) / 2)
  cohens_d = np.abs(cohens_d)
  print(f"Cohen's d for {column}: {cohens_d}")

  if cohens_d < 0.2:
    print(f'column {column} has small effect on loan default')
  elif 0.2 <= cohens_d < 0.5:
    print(f'column {column} has medium effect on loan default')
  elif cohens_d >= 0.5:
    print(f'column {column} has large effect on loan default')
  print()

